  public static HashSet<String> getAllPokeNames() {
    HashSet<String> values = new HashSet<String>();
    for (Pokedex poke : Pokedex.values()) {
      values.add(poke.getPokeName());
    }
    return values;
  }
  
  public static Pokedex getPokeFromString(String userInput) {
    for (Pokedex poke : Pokedex.values()) {
      if (poke.POKENAME.equalsIgnoreCase(userInput)) {
        return poke;
      }
    }
    return null;
  }
  
